    <script>
      function deleteAllCookies() {
          var cookies = document.cookie.split(";");

          for (var i = 0; i < cookies.length; i++) {
              var cookie = cookies[i];
              var eqPos = cookie.indexOf("=");
              var name = eqPos > -1 ? cookie.substr(0, eqPos) : cookie;
              document.cookie = name + "=;expires=Thu, 01 Jan 1970 00:00:00 GMT";
          }
      }
      var countDownDate = new Date('{{Session::get('l_e_suspend')}}').getTime();
      var x = setInterval(function() {
        var now = new Date().getTime();
        var distance = countDownDate - now;
        var days = Math.floor(distance / (1000 * 60 * 60 * 24));
        var hours = Math.floor((distance % (1000 * 60 * 60 * 24)) / (1000 * 60 * 60));
        var minutes = Math.floor((distance % (1000 * 60 * 60)) / (1000 * 60));
        var seconds = Math.floor((distance % (1000 * 60)) / 1000);

        if (distance < 0) {
          $.ajax({
            type: 'get',
            url: 'c_s'});
          clearInterval(x);
          $('#cxcxcx').remove();
          $('#login-button').append("<button type='submit' class='btn btn-primary btn-lg btn-block' tabindex='4'>Login</button>");
        }else{
          $('#cxcxcx').remove();
          $('#login-button').append("<button type='button' id='cxcxcx' class='btn btn-primary btn-lg btn-block' tabindex='4' disabled>Tunggu Sampai " + seconds + " Detik</button>");
        }
      }, 1000);
    </script>
